import React from 'react'
import CarouselPage from '../functional/Carousel'
import image from '../../assets/img/logo.png'

const LandingPage = () => {
    return (
        <div className="container">
            <img src={image} alt="logo"/>
            <CarouselPage />
        </div>
    )
}

export default LandingPage;
